import React from "react";
import img01 from "../imgs/lion2.png";
import img02 from "../imgs/sih.png";
import '../public/Styles.css'

function Header() {
  return (
    <div>
      <div className="nav">
        <img src={img01} height="70px" width="50px"/>
        <div className="headingg">
            <h1 text-align="center"><b>NATIONAL GRIEVANCE PORTAL</b></h1>
        </div>
        <img src={img02} height="80px"/>
      </div>

      <div className="header02"></div>

    </div>
  );
}

export default Header;
